import React from "react";
import { FirstName, LastName } from "./App";

const ComF = () => {
  return (
    <div>
      <FirstName.Consumer>
        {(fname) => {
          <LastName.Consumer>
            {(lname) => {
              return (
                <h1>
                  Is It really working {fname} {lname}
                </h1>
              );
            }}
          </LastName.Consumer>;
        }}
      </FirstName.Consumer>
    </div>
  );
};

export default ComF;
